webpackJsonp([80],{345:function(e,t){e.exports={data:{config:{siteMetadata:{title:"Bricolage",author:"Kyle Mathews"}},markdown:{id:"/Users/kylemathews/programs/blog/pages/2009-07-27---startup-chronicles-1/index.md",bodyHTML:"<p>Running a startup is an interesting experience -- alternatively terrifying and thrilling. Today I read an article that made me burst out laughing. Paul Graham, the startup guru and founder of <a href=\"http://ycombinator.com/\">Y Combinator</a> wrote:</p>\n<blockquote>\n<p>A company tends to feel rather theoretical when you first start it. It's legally a company, but you feel like you're lying when you call it one.</p>\n</blockquote>\n<p>That so perfectly describes how I feel. I tell people I'm running a company but the reality is I'm a poor college student working from a small messy apartment trying to turn vaporware into sell-able software. Shouldn't a company have employees? a product? offices? revenue even? :)</p>\n<p>Read the rest:</p>\n<p><a href=\"http://paulgraham.com/ramenprofitable.html\">Ramen Profitable</a></p>\n",frontmatter:{readNext:null,title:"Startup Chronicles #1",tags:["entrepreneurship","startup"],date:"July 27, 2009"}}},pathContext:{path:"/startup-chronicles-1/",component:"/Users/kylemathews/programs/blog/pages/blog-post.js"}}}});
